              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
          </div>
        </div>
      </div>
    </>
  );
}

export default Navbar;
